post_text:
The Willis High School National Honor Society officers were introduced at the board meeting May 13. A written report was provided detailing this year's activities.

On February 12, 2019 the Willis High School Chapter of the National Honor Society inducted 74 new members, 14 seniors and 60 juniors giving the chapter a total of 121 members for the 2018-19 school year.

This year the NHS:
Collected 2,000+ lbs. food - donated to TLC Pantry;
Recycled 37 lbs. of aluminum cans;
Donated $845 gift cards to Children’s Safe Harbor;
Donated 63 stuffed animals to Children’s Safe Harbor;
Participated in more than five thousand hours of community service as a group.

Left to Right: Tommy Reed, Sponsor; Matthew Nell, President; Victoria Jungwirth, Vice President; Jayan Bhakta, Secretary; Benjamin Irvine, Activities Director.

